.v-otp-input {
  border-radius: 4px;
  align-items: center;
  display: flex;
  justify-content: center;
  padding: 0.5rem 0;
  position: relative;
}
.v-otp-input .v-field {
  height: 100%;
}

.v-otp-input__divider {
  margin: 0 8px;
}

.v-otp-input__content {
  align-items: center;
  display: flex;
  gap: 0.5rem;
  height: 64px;
  padding: 0.5rem;
  justify-content: center;
  max-width: 320px;
  position: relative;
  border-radius: inherit;
}
.v-otp-input--divided .v-otp-input__content {
  max-width: 360px;
}

.v-otp-input__field {
  color: inherit;
  font-size: 1.25rem;
  height: 100%;
  outline: none;
  text-align: center;
  width: 100%;
}
.v-otp-input__field[type=number]::-webkit-outer-spin-button, .v-otp-input__field[type=number]::-webkit-inner-spin-button {
  -webkit-appearance: none;
  margin: 0;
}
.v-otp-input__field[type=number] {
  -moz-appearance: textfield;
}

.v-otp-input__loader {
  align-items: center;
  display: flex;
  height: 100%;
  justify-content: center;
  width: 100%;
}
.v-otp-input__loader .v-progress-linear {
  position: absolute;
}
